import React from 'react';
//import{Link} from "react-router-dom";
import './login.css';
import logo from './byjus.png'; // import the logo image

function Login() {
  function con() {
    alert('LoggedIn Successfully');
  }
  return (
    <div>
      <div className='login'>
        <div className='logo'>
          <img src={logo} alt='logo' width='150' height='100' />
        </div>
        <p>
          <b>Let's Get Started</b>
          <br />
          Enter your mobile number to sign up/sign in to your BYJU'S account
        </p>
        <div className='form'>
          <div className='name'>
            <label>Name:</label>
            <br />
            <input type='text' />
          </div>
          <br />
          <div className='phno'>
            <label>Mobile No:</label>
            <br />
            <input type='number' />
          </div>
          <br />
        </div>
        <div className='btn'>
          <button onClick={con}>Continue</button>
        </div>
      </div>
    </div>
  );
}

export default Login;
